/// <summary>
/// Initializes the history record that is based on a <c>PurchTable</c> record.
/// </summary>
/// <param name="_purchTable">
/// A <c>PurchTable</c> record on which to base initialization.
/// </param>
public void initFromPurchTable(PurchTable _purchTable)
{
    #ISOCountryRegionCodes
    // <GEERU>
    PurchTableMap_RU        purchTableMap_RU;
    PurchTableHistory_RU    purchTableHistory_RU;
    // </GEERU>
    PurchTableMap_W         purchTableMap_W;
    PurchTableHistory_W     purchTableHistory_W;
    // <GBR>
    PurchTableMap_BR        purchTableMap_BR;
    PurchTableHistory_BR    purchTableHistory_BR;
    // </GBR>

    this.purchTableVersioning().copyVersion(_purchTable.purchTableVersioning());

    if (IntrastatCountryRegionParameters::isInEUByIsoCode())
    {
        // Reset and copy the TransportationDocument reference as it is required to be unique.
        this.TransportationDocument = 0;
        TransportationDocument::copy(_purchTable, this);
    }

    // <GEERU>
    if (PurchTableHistory_RU::isExtensionEnabled())
    {
        purchTableMap_RU.data(_purchTable.purchTable_RU());
        purchTableHistory_RU.data(purchTableMap_RU.data());
        this.SysExtensionSerializerMap::packExtensionTable(purchTableHistory_RU);
    }
    // </GEERU>
    // <GBR>
    if (PurchTableHistory_BR::isExtensionEnabled())
    {
        purchTableMap_BR.data(_purchTable.purchTable_BR());
        purchTableHistory_BR.data(purchTableMap_BR.data());
        this.SysExtensionSerializerMap::packExtensionTable(purchTableHistory_BR);
    }
    // </GBR>
    if (PurchTableHistory_W::isExtensionEnabled())
    {
        purchTableMap_W.data(_purchTable.purchTable_W());
        purchTableHistory_W.data(purchTableMap_W.data());
        this.SysExtensionSerializerMap::packExtensionTable(purchTableHistory_W);
    }
}

public void insert()
{
    ttsBegin;
    super();
    this.SysExtensionSerializerMap::postInsert();
    ttsCommit;
}

/// <summary>
/// Retrieves a dimension set that holds the merged combination of the current <c>defaultDimension</c>
/// field on this table and the provided dimension set.
/// </summary>
/// <param name="_primaryDefaultDimension">
/// A first dimension set that should be merged with the current <c>defaultDimension</c> field on this
/// table.
/// </param>
/// <param name="_secondaryDefaultDimension">
/// A second dimension set that should be merged with the current <c>defaultDimension</c> field on this
/// table; optional.
/// </param>
/// <param name="_dimensionMerge">
/// A <c>dimensionMerge</c> object that was previously initialized from the current buffer; optional.
/// </param>
/// <returns>
/// A dimension set that holds the merged combination of the current <c>defaultDimension</c> field on
/// this table and the specified dimension set.
/// </returns>
/// <remarks>
/// This method makes sure that potential linked dimensions are not overwritten when they are merged.
/// </remarks>

public DimensionDefault mergeDimension(
    DimensionDefault _primaryDefaultDimension,
    DimensionDefault _secondaryDefaultDimension = 0,
    DimensionMerge   _dimensionMerge = DimensionMerge::newFromTable(this,
                                                                    this.companyInfo().RecId
                                                                    )
    )
{
    return _dimensionMerge.merge(_primaryDefaultDimension, _secondaryDefaultDimension);
}

