/// <summary>
/// Indicates whether the specified <c>PurchTable</c> record has a history stored in the
/// <c>PurchTableHistory</c> table.
/// </summary>
/// <param name="_purchTable">
/// A <c>PurchTable</c> record to check for existence of history versions.
/// </param>
/// <returns>
/// true if the history of the specified record exists; otherwise, false.
/// </returns>
public static boolean exist(PurchTable _purchTable)
{
    if (_purchTable.PurchId)
    {
        return (select firstonly purchTableHistory
                    where purchTableHistory.PurchId == _purchTable.PurchId).RecId != 0;
    }

    return false;
}

public static boolean existDocumentState(PurchId _purchId, VersioningDocumentState _documentState)
{
    date dateFrom = dateNull();
    date dateTo = dateMax();

    return _purchId ? (select firstonly validTimeState(dateFrom, dateTo) RecId from PurchTableHistory
                            where PurchTableHistory.PurchId == _purchId
                                && PurchTableHistory.DocumentState == _documentState).RecId != 0 : false;
}

/// <summary>
/// Finds the specified record in the <c>PurchTableHistory</c> table.
/// </summary>
/// <param name="_purchId">
/// A purchase order identifier for which to find the history header version.
/// </param>
/// <param name="_validTime">
/// A time for which to find a valid history version.
/// </param>
/// <returns>
/// A record in the <c>PurchTableHistory</c> table if one exists; otherwise, an empty record.
/// </returns>
public static PurchTableHistory find(PurchId _purchId, utcdatetime _validTime = DateTimeUtil::utcNow())
{
    PurchTableHistory purchTableHistory;

    if (_purchId)
    {
        select firstonly validTimeState(_validTime) purchTableHistory
            where purchTableHistory.PurchId == _purchId;
    }

    return purchTableHistory;
}

/// <summary>
/// Finds the first record in the <c>PurchTableHistory</c> table for the specified purchase order.
/// </summary>
/// <param name="_purchId">
/// A purchase order identifier for which to find the first history header version.
/// </param>
/// <returns>
/// A record in the <c>PurchTableHistory</c> table if one exists; otherwise, an empty record.
/// </returns>
public static PurchTableHistory findFirst(PurchId _purchId)
{
    PurchTableHistory purchTableHistory;
    utcdatetime       minValue = DateTimeUtil::minValue();
    utcdatetime       maxValue = DateTimeUtil::maxValue();

    if (_purchId)
    {
        select firstonly validTimeState(minValue, maxValue) purchTableHistory
            order by purchTableHistory.ValidFrom asc
            where purchTableHistory.PurchId == _purchId;
    }

    return purchTableHistory;
}

/// <summary>
/// Finds the specified record in the <c>PurchTableHistory</c> table.
/// </summary>
/// <param name="_recId">
/// The record identifier of the record to find.
/// </param>
/// <param name="_forUpdate">
/// A Boolean value that indicates whether to select the returned record for update; optional.
/// </param>
/// <returns>
/// A <c>PurchTableHistory</c> record if one exists; otherwise, an empty record.
/// </returns>
static PurchTableHistory findRecId(recId       _recId,
                                   boolean     _forUpdate = false)
{
    PurchTableHistory   purchTableHistory;
    utcdatetime         minValue = DateTimeUtil::minValue();
    utcdatetime         maxValue = DateTimeUtil::maxValue();

    purchTableHistory.selectForUpdate(_forUpdate);

    select validTimeState(minValue, maxValue) purchTableHistory
        where purchTableHistory.RecId == _recId;

    return purchTableHistory;
}

